import React, { useState, useEffect } from 'react';
import { getMapData } from './api';
import './styles.css';

function App() {
    const [imageUrl, setImageUrl] = useState("");

    useEffect(() => {
        const fetchData = async () => {
            const data = await getMapData();
            if (data) {
                setImageUrl(data.image_url);
            }
        };
        fetchData();
    }, []);

    return (
        <div className="App">
            <h1>Coastline Analysis</h1>
            {imageUrl ? <img src={imageUrl} alt="Satellite Data" /> : <p>Loading...</p>}
        </div>
    );
}

export default App;
